import { FaTwitter } from "react-icons/fa"
import { FaGithub } from "react-icons/fa"
import { FaLinkedin } from "react-icons/fa"

import './Footer.css';

const Footer = () => {
    return (
        <div className="footer">
            <div className="icons">
                <div className="icon">
                    <a href=""></a>
                    <FaTwitter size={30} />
                </div>
                <div className="icon">
                    <FaGithub size={30} />
                </div>
                <div className="icon">
                    <FaLinkedin size={30} />
                </div>
            </div>
            <p className="copyright">
                RoseAshTech © 2021 LLC. All Rights Reserved
            </p>
        </div >
    )
}

